import React from 'react';
import Image from 'react-bootstrap/Image';

class ResidentPhoto extends React.Component {
    render() {
        return (
          <form classname="container" formtext-padding="10 px">
            <div className="container">
                <p>Look At Me:</p>
                <Image src="https://images.pexels.com/photos/1786258/pexels-photo-1786258.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" thumbnail margin="10px"/> 
            </div>
          </form>
        );
      }
  }

  export default ResidentPhoto;
